use epam_project;

SET NAMES 'utf8';
DROP TABLE IF EXISTS passed_tests;
DROP TABLE IF EXISTS answer;
DROP TABLE IF EXISTS question;
DROP TABLE IF EXISTS test;
DROP TABLE IF EXISTS complexity;
DROP TABLE IF EXISTS subject;
DROP TABLE IF EXISTS user;
DROP TABLE IF EXISTS status;
DROP TABLE IF EXISTS role;

#-------------------------------------------------------------------------------------------
create table role (
	id int AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(20)
) DEFAULT CHARSET=utf8;
#-------------------------------------------------------------------------------------------
create table status (
	id int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name VARCHAR(20) NOT NULL
) DEFAULT CHARSET=utf8;
#-------------------------------------------------------------------------------------------
create table user (
	id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    username VARCHAR(25) UNIQUE NOT NULL,
    password VARCHAR(128) NOT NULL,
    salt int NOT NULL,
    first_name VARCHAR(25) NOT NULL,
    last_name VARCHAR(25) NOT NULL,
    role_id INT DEFAULT 2,
    status_id INT DEFAULT 1,
    FOREIGN KEY (role_id) REFERENCES role(id) ON DELETE SET NULL,
    FOREIGN KEY (status_id) REFERENCES status(id) ON DELETE SET NULL
) DEFAULT CHARSET=utf8;
#-------------------------------------------------------------------------------------------
create table subject (
	id int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name VARCHAR(50) NOT NULL
) DEFAULT CHARSET=utf8;
#-------------------------------------------------------------------------------------------
create table complexity (
	id int AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name VARCHAR(25) NOT NULL,
    scale int NOT NULL
) DEFAULT CHARSET=utf8;

#-------------------------------------------------------------------------------------------
CREATE TABLE test(
	id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    name VARCHAR(150) NOT NULL,
    subject_id INT DEFAULT 1,
    complexity_id INT DEFAULT 1,
    duration_sec INT NOT NULL,
    is_active BOOLEAN NOT NULL,
	FOREIGN KEY (subject_id) REFERENCES subject(id) ON DELETE SET NULL,
    FOREIGN KEY (complexity_id) REFERENCES complexity(id) ON DELETE SET NULL
) DEFAULT CHARSET=utf8;

#-------------------------------------------------------------------------------------------
CREATE TABLE question(
	id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    text VARCHAR(400) NOT NULL,
    test_id INT NOT NULL,
    FOREIGN KEY (test_id) REFERENCES test(id) ON DELETE CASCADE
) DEFAULT CHARSET=utf8;

#-------------------------------------------------------------------------------------------
CREATE TABLE answer (
	id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    question_id INT NOT NULL,
    text VARCHAR(400) NOT NULL,
    isCorrect BOOLEAN NOT NULL,
    FOREIGN KEY (question_id) REFERENCES question(id) ON DELETE CASCADE
) DEFAULT CHARSET=utf8;

#-------------------------------------------------------------------------------------------
CREATE TABLE passed_tests (
	id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
    user_id INT NOT NULL,
    test_id INT NOT NULL,
    question_num INT NOT NULL,
    correct_answers INT NOT NULL,
    grade FLOAT NOT NULL,
    time_spent INT NOT NULL,
    date TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (user_id) REFERENCES user(id) ON DELETE CASCADE,
    FOREIGN KEY (test_id) REFERENCES test(id) ON DELETE CASCADE
) DEFAULT CHARSET=utf8;

